var fiFI={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Sallia","Allow in your wallet":"Salli lompakossasi","Allow {symbol} first":["Salli ensin ",["symbol"]],"Allowance pending":"Korvaus vireillä","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Tapahtui virhe yritettäessä suorittaa tämä vaihto. Saatat joutua lisäämään luistonsietokykyäsi. Jos se ei toimi, kaupankäynnin kohteena olevan tunnuksen kanssa saattaa olla ristiriita. Huomautus: siirto- ja uudelleentase-tunnusten maksu ei ole yhteensopiva Uniswap V3: n kanssa.","Approval pending":"Hyväksyntä odottaa","Approve":"Hyväksy","Approve Permit2":"Approve Permit2","Approve in your wallet":"Hyväksy lompakossasi","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Hyväksy ensin ",["symbol"]],"Auto":"Automaattinen","Auto Router":"Automaattinen reititin","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Sulje","Confirm in your wallet":"Vahvista lompakossasi","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Yhdistä lompakko","Connecting…":"Yhdistäminen…","Continue":"Continue","Convert {0} to {1}":["Muunna ",["0"]," ",["1"],":ksi"],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Irrota lompakko","Dismiss":"Sulje","Enter an amount":"Syötä summa","Error fetching trade":"Virhe kauppaa haettaessa","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Haetaan paras hinta…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Suuri lipsahdus lisää hintojen liikkeiden riskiä","I don't have a wallet":"Minulla ei ole lompakkoa","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Riittämätön ",["0"]," saldo"],"Invalid recipient":"Virheellinen vastaanottaja","Max":"Maksimi","Max slippage":"Max liukuminen","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Puuttuvat riippuvuudet","Network fee":"Verkkomaksu","No results found.":"Tuloksia ei löytynyt.","No tokens are available on this network. Please switch to another network.":"Tunnuksia ei ole saatavilla tässä verkossa. Vaihda toiseen verkkoon.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Anna kelvollinen lipsuma %","Powered by the Uniswap protocol":"Toimii Uniswap-protokollalla","Price impact":"Hintavaikutus","Price updated":"Hinta päivitetty","Reload":"Reload","Reload the page":"Lataa sivu uudelleen","Request rejected":"Request rejected","Review swap":"Arvostelun vaihto","Search by token name or address":"Hae tunnusnimellä tai osoitteella","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Jotain meni pieleen","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Menestys","Swap":"Vaihda","Swap failed: {0}":["Vaihto epäonnistui: ",["0"]],"Switch network":"Vaihda verkkoa","Switch network in your wallet":"Vaihda verkkoa lompakossasi","Switching network":"Vaihto verkkoa","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Vaihto ei tyydyttänyt Uniswap-invarianttia x*y=k. Tämä tarkoittaa yleensä sitä, että yksi vaihtamistasi rahakkeista käyttäytyy mukautetusti siirron yhteydessä.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Syöterahaketta ei voida siirtää. Syöterahakkeessa voi olla ongelma.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Tulosrahaketta ei voida siirtää. Tulosrahakkeessa voi olla ongelma.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Tulostunnusta ei voi siirtää. Tulostunnuksessa voi olla ongelma. Huomautus: siirto- ja uudelleentase-tunnusten maksu ei ole yhteensopiva Uniswap V3: n kanssa.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Tämä kauppa ei onnistu hintaliikkeen vuoksi. Yritä lisätä liukastumistoleranssia. Huomautus: siirto- ja uudelleentase-tunnusten maksu ei ole yhteensopiva Uniswap V3: n kanssa.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Tämä tapahtuma ei onnistu joko hinnanmuutoksen tai siirtopalkkion vuoksi. Yritä nostaa luistonsietoprosenttia.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Tapahtuman määräaika","Transaction rejected":"Kauppa hylätty","Transaction submitted":"Tapahtuma lähetetty","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Yritä lisätä liukastumistoleranssiasi.<0/>HUOMAA: Siirtomaksu ja uudelleenperustamistunnukset eivät ole yhteensopivia Uniswap V3:n kanssa.","Unexpected error. Could not estimate gas for the swap.":"Odottamaton virhe. Vaihdon kaasua ei voitu arvioida.","Unexpected issue with estimating the gas. Please try again.":"Odottamaton ongelma kaasun arvioinnissa. Yritä uudelleen.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Näkymä Etherscanissa","Wallet disconnected":"Wallet disconnected","Warning":"Varoitus","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Tapahtumasi palautetaan, jos se on ollut vireillä tätä pidemmän ajan.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Tapahtumasi peruuntuu, jos hinta muuttuu epäsuotuisasti tätä prosenttiosuutta enemmän.","minutes":"minuuttia","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," maksu"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

